import React from "react";
import "../styles/Navbar.css";

const styles = {
  bg: {
    background: "#f4f4f4"
  },
  text: {
    fontSize: "100px"
  }
}
function Navbar() {
  return (
    <nav className="navbar" style = {styles} >
      <a href="/">Welcome</a>
    </nav>
  );
}

export default Navbar;
